import axios from "axios";

export class CustomerService{

    baseUrl = "http://localhost:8080/api/v1/customer/"

    async getCustomer(email){
        const res = await axios.get(this.baseUrl+"search/" + email);
        return await res.data;
    }

    async postCustomer(customer) {

        conf.validateStatus = (status) => {return (status >= 200 && status < 300) || status == 404}

        return await axios.post(this.baseUrl + "create", customer, conf).then(res => res.data);
    }
}
